import React from "react";
import { Box, Grid, Text } from "@mantine/core";

const Home = () => {
  return (
    <>
      <Box
        h={40}
        w={`100%`}
        bg="gray.2"
        mt="xs"
        gap="md"
        justify="center"
        align="center"
      >
        <Text>Home</Text>
        <Text></Text>
        <Text></Text>
        <Text></Text>
      </Box>
      <Grid>
        <Grid.Col span={4}>
          <Flex
            mih={50}
            bg="rgba(0, 0, 0, .3)"
            gap="md"
            justify="center"
            align="center"
            direction="row"
            wrap="wrap"
          >
            <Text>Layout</Text>
          </Flex>
        </Grid.Col>
        <Grid.Col span={4}>2</Grid.Col>
        <Grid.Col span={4}>3</Grid.Col>
      </Grid>
    </>
  );
};

export default Home;
